import React from "react";

class SkillBadge extends React.Component {
  render() {
    return (
      <div>
        <div>
          <h3>Platzi Conf</h3>
          <img src="" alt="img"></img>
        </div>
        <div>
          <img src="" alt="img"></img>
          <h1>Cristhian Franco</h1>
        </div>
        <div>
          <h3>Desarrollador Fullstack</h3>
          <div>
            <img src="" alt="img"></img>
            <a>@crodfranco</a>
            <img src="" alt="img"></img>
          </div>
        </div>
        <div>
          <a>#PlatziConf</a>
        </div>
      </div>
    );
  }
}

export default SkillBadge;
